import React from 'react'
import ItemList from './ItemList'

export default function Catalog() {
  const items = require('./data/catalog.json')

  return (
    <div>
      <table>
        <tr><th>Item Type</th><th>Color</th></tr>
        <ItemList items={items}/>
      </table>
    </div>
  )
}
